import React, { Component } from "react";
import "./counter.css";
class Counter extends Component {
  render() {
    return (
      <div id="page">
        <div class="header">
          <h1>CINEPHILE</h1>{" "}
          <div class="searchbar">
            <input
              type="text"
              id="myInput"
              onkeyup="myFunction()"
              placeholder=" Enter movie Name here"
            ></input>
            <button class="gosearch">GO</button>
          </div>{" "}
          {/* search bar div ends here */}
        </div>
        {/* header div ends here */}
        <div id="all_details">
          <div id="moviereview" style={{ backgroundColor: "#aaa" }}>
            <div id="trailer" style={{ backgroundColor: "#cde" }}></div>
            <div id="tomatometer" style={{ backgroundColor: "#abc" }}></div>
            <div id="cast" style={{ backgroundColor: "#fgh" }}></div>
          </div>
          <div id="twitterfeed" style={{ backgroundColor: "#bbb" }}></div>
          <div id="screen_location" style={{ backgroundColor: "#ccc" }}></div>
        </div>
      </div>
    );
  }
}

export default Counter;
